import React, { useState } from 'react';
import './Marketplace.css';
import logo from '../../../assets/logo.png'; // adjust path if needed
import Cart from "./Cart"; 



const Marketplace = () => {
  const [crops, setCrops] = useState([
    { id: 1, name: 'Maize', price: 100, image: 'data:image/jpeg;base64,', stock: 50, description: 'Fresh maize from local farms' },
    { id: 2, name: 'Wheat', price: 80, image: 'data:image/jpeg;base64,', stock: 30, description: 'High-quality wheat grains' },
    { id: 3, name: 'Teff', price: 120, image: 'data:image/jpeg;base64,', stock: 20, description: 'Organic Teff for Ethiopian cuisine' },
    { id: 4, name: 'Barley', price: 90, image: 'data:image/jpeg;base64,', stock: 25, description: 'Healthy barley for cereals' },
    { id: 5, name: 'Sorghum', price: 70, image: 'data:image/jpeg;base64,', stock: 40, description: 'Locally grown Sorghum grains' },
    { id: 6, name: 'Beans', price: 150, image: 'data:image/jpeg;base64,', stock: 60, description: 'Protein-rich beans' },
    ,
    { id: 7, name: 'Maize', price: 100, image: 'data:image/jpeg;base64,', stock: 50, description: 'Fresh maize from local farms' },
    { id: 8, name: 'Wheat', price: 80, image: 'data:image/jpeg;base64,', stock: 30, description: 'High-quality wheat grains' },
    { id: 9, name: 'Teff', price: 120, image: 'data:image/jpeg;base64,', stock: 20, description: 'Organic Teff for Ethiopian cuisine' },
    ,
    { id: 10, name: 'Maize', price: 100, image: 'data:image/jpeg;base64,', stock: 50, description: 'Fresh maize from local farms' },
    { id: 11, name: 'Wheat', price: 80, image: 'data:image/jpeg;base64,', stock: 30, description: 'High-quality wheat grains' },
    { id: 12, name: 'Teff', price: 120, image: 'data:image/jpeg;base64,', stock: 20, description: 'Organic Teff for Ethiopian cuisine' },
 


]);
   const [cart, setCart] = useState([]);

  const addToCart = (crop) => {
    const existing = cart.find((c) => c.id === crop.id);
    if (existing) {
      setCart(
        cart.map((c) =>
          c.id === crop.id ? { ...c, quantity: c.quantity + 1 } : c
        )
      );
    } else {
      setCart([...cart, { ...crop, quantity: 1 }]);
    }
  };

  const increaseQuantity = (id) => {
    setCart(
      cart.map((c) =>
        c.id === id && c.quantity < c.stock
          ? { ...c, quantity: c.quantity + 1 }
          : c
      )
    );
  };

  const decreaseQuantity = (id) => {
    setCart(
      cart
        .map((c) =>
          c.id === id && c.quantity > 1
            ? { ...c, quantity: c.quantity - 1 }
            : c
        )
        .filter((c) => c.quantity > 0)
    );
  };

  const buyNow = () => {
    const total = cart.reduce(
      (sum, item) => sum + item.price * item.quantity,
      0
    );
    alert(`Thank you for your purchase!\nTotal: ${total} ETB`);
    setCart([]); // clear cart after purchase
  };

  return (
    <div className="marketplace-wrapper">
      {/* Navbar */}
     

      {/* Crops Grid */}
      <div className="crop-list">
        {crops.map((crop) => (
          <div key={crop.id} className="crop-card">
            <img src={crop.image} alt={crop.name} className="crop-image" />
            <h3>{crop.name}</h3>
            <p className="crop-description">{crop.description}</p>
            <p><strong>{crop.price} ETB</strong> / kg</p>
            <p>Stock: {crop.stock} kg</p>
            <button onClick={() => addToCart(crop)}>Add to Cart</button>
          </div>
        ))}
      </div>

      {/* External Cart Component */}
     
      <Cart
        cart={cart}
        increaseQuantity={increaseQuantity}
        decreaseQuantity={decreaseQuantity}
        buyNow={buyNow}
      />
    
    </div>
  );
};

export default Marketplace;